struct TAGDIR
{
    void* handle;
    struct dirent dirent;
};


DIR* opendir(const char* name)
{
    (void)((!!(name != 0)) || (_wassert(L"name != 0", L"file", (unsigned)(1)), 0));
    WIN32_FIND_DATAA fdfile;

    char path[260] = { 0 };
    strcat(path, name);
    strcat(path, "\\*.*");

    HANDLE handle = FindFirstFileA(path, &fdfile);

    if (handle != ((HANDLE)(LONG_PTR)-1))
    {
        DIR* p = calloc(1, sizeof * p);
        if (p)
        {
            p->handle = handle;
            return p;
        }
        else
        {

            FindClose(handle);
        }
    }
    else
    {
        (*_errno()) = windows_error_to_posix(GetLastError());
    }

    return  ((void*)0);
}

int closedir(DIR* dirp)
{
    FindClose(dirp->handle);
    free(dirp);
    return 0;
}

struct dirent* readdir(DIR* dirp)
{
    WIN32_FIND_DATAA fdfile;
    BOOL b = FindNextFileA(dirp->handle, &fdfile);
    if (b)
    {

        memset(&dirp->dirent, 0, sizeof(dirp->dirent));

        if (fdfile.dwFileAttributes & 0x00000010)
        {
            dirp->dirent.d_type |= DT_DIR;
        }


        strncpy(dirp->dirent.d_name,
            fdfile.cFileName,
            sizeof(dirp->dirent.d_name) - 1);

        return &dirp->dirent;
    }
    else
    {
        (*_errno()) = windows_error_to_posix(GetLastError());
    }
    return  ((void*)0);
}



int copy_file(const char* pathfrom,
    const char* pathto)
{
    char buf[4096];
    size_t nread;
    int saved_errno;

    FILE* fd_from = fopen(pathfrom, "rb");
    if (fd_from == ((void*)0))
        return -1;

    FILE* fd_to = fopen(pathto, "wb");
    if (fd_to == ((void*)0))
        goto out_error;

    while (nread = fread(buf, sizeof(char), sizeof buf, fd_from), nread > 0)
    {
        char* out_ptr = buf;
        size_t nwritten;

        do
        {
            nwritten = fwrite(out_ptr, sizeof(char), nread, fd_to);

            nread -= nwritten;
            out_ptr += nwritten;
        } while (nread > 0);
    }

    if (nread == 0)
    {
        if (fclose(fd_to) < 0)
        {
            fd_to = ((void*)0);
            goto out_error;
        }
        fclose(fd_from);


        return 0;
    }

out_error:
    saved_errno = (*_errno());

    fclose(fd_from);

    if (fd_to != ((void*)0))
        fclose(fd_to);

    return saved_errno;
}

int copy_folder(const char* from, const char* to)
{
    int errcode = _mkdir(to);
    if (errcode != 0)
    {
        return errcode;
    }

    DIR* dir = opendir(from);

    if (dir == ((void*)0))
    {
        return  (*_errno());
    }

    struct dirent* dp;
    while ((dp = readdir(dir)) != ((void*)0))
    {
        if (strcmp(dp->d_name, ".") == 0 || strcmp(dp->d_name, "..") == 0)
        {

            continue;
        }

        char fromlocal[260];
        snprintf(fromlocal, 260, "%s/%s", from, dp->d_name);

        char tolocal[260];
        snprintf(tolocal, 260, "%s/%s", to, dp->d_name);

        if (dp->d_type & DT_DIR)
        {
            errcode = copy_folder(fromlocal, tolocal);
        }
        else
        {
            errcode = copy_file(fromlocal, tolocal);
        }

        if (errcode != 0)
            break;
    }

    closedir(dir);
    return errcode;
}


